import React from "react";

const Item = (history) => {
  console.log(history);
  const deleteHandler = () => {
    fetch("http://localhost:3001/historys/" + history.id, {
      method: "DELETE",
    });
    console.log("delete" + history.id);
  };
  return (
    <>
      <div key={history.id} className="itemBox">
        <div>{history.title}</div>
        <div>{history.amount}</div>
        <div>{history.createdAt}</div>
        <div>
          <button onClick={deleteHandler}>삭제</button>
          <button>수정</button>
        </div>
      </div>
    </>
  );
};
export default Item;
